import React from 'react';

class Navbar extends React.Component {
    render() {
        return (
            <div className="top-nav">
                <ul>
                    <li><a href="#">Home</a></li>
                    <li>
                        <div className="dropdown">
                            <a href="#">Global Song List <i className="fa fa-angle-down"></i></a>
                            <div className="dropdown-content">
                                <p><a className="dropdown-link" href="#">SOUND VOLTEX</a></p>
                                <p><a className="dropdown-link" href="#">DanceDanceRevolution sssssssssssss <br /> (coming soon)</a></p>
                                <p><a className="dropdown-link" href="#">Beatmania IIDX <br /> (coming soon)</a></p>
                            </div>
                        </div>
                    </li>
                    <li><a href="#">User List</a></li>
                </ul>
            </div>
        )
    }
}

export default Navbar;
